    <script>
        function generatePDF(order_id) {
            // Get order details from PHP embedded in the page

            var status = document.querySelector('#order-' + order_id + ' .transactionStatusPart p span').innerText;

            var orderID = document.querySelector('#order-' + order_id + ' .transactionTopPart p:nth-child(1)').innerText.split(': ')[1];
            var orderDate = document.querySelector('#order-' + order_id + ' .transactionTopPart p:nth-child(3)').innerText.split(': ')[1];
            var cashier = document.querySelector('#order-' + order_id + ' .transactionTopPart p:nth-child(4)').innerText.split(': ')[1];

            // Collect order items
            var items = [];
            var orderItems = document.querySelectorAll('#order-' + order_id + ' .orderedItems p');
            orderItems.forEach(function (item) {
                items.push(item.innerText);
            });

            // Collect totals
            var subtotal = document.querySelector('#order-' + order_id + ' .transactionBottomLeftPart p:nth-child(1)').innerText.split(': ')[1];
            var tax = document.querySelector('#order-' + order_id + ' .transactionBottomLeftPart p:nth-child(2)').innerText.split(': ')[1];
            var total = document.querySelector('#order-' + order_id + ' .transactionBottomLeftPart p:nth-child(3)').innerText.split(': ')[1];

            // Create the PDF using pdfMake
            const docDefinition = {
                pageSize: {
                    width: 162,
                    height: 'auto'
                },
                pageMargins: [10, 10, 10, 10],
                content: [
                    // Title and Address
                    { image: "data:image/png;base64,", width: 20, alignment: 'center' },

                    { text: 'Kedai Kopi Kita', style: 'header', alignment: 'center' },
                    { text: 'Jalan W.R. Supratman No.9, Air Raja', style: 'subHeader', alignment: 'center' },
                    { text: 'Tanjungpinang Timur, Tanjungpinang, Kepulauan Riau', style: 'subHeader', alignment: 'center' },
                    { text: '_______________________________________', style: 'separator', alignment: 'center' },

                    // Order Details
                    { text: 'No Transaksi: ' + orderID, style: 'details' },
                    { text: 'Tanggal: ' + orderDate, style: 'details' },
                    { text: 'Kasir: ' + cashier, style: 'details' },


                    // Items
                    {
                        table: {
                            widths: ['*', 'auto'], // Product Name and Price columns
                            body: [
                                [{ text: 'Item', bold: true, fontSize: 5 }, { text: 'Harga', bold: true, alignment: 'right', fontSize: 5 }],
                                ...items.map(item => {
                                    let [quantityProduct, price] = item.split(' - Rp ');
                                    return [{ text: quantityProduct, alignment: 'left', fontSize: 6 }, { text: 'Rp ' + (parseFloat(quantityProduct) * parseFloat(price)).toFixed(3), alignment: 'right', fontSize: 6 }];
                                })
                            ]
                        },
                        layout: 'noBorders',
                        margin: [0, 5] // Margin for spacing
                    },

                    {
                        table: {
                            widths: ['*', 'auto'],

                            body: [
                                [{ text: 'Subtotal', bold: true, fontSize: 6 }, { text: subtotal, alignment: 'right', fontSize: 6 }],
                                [{ text: 'Pajak', bold: true, fontSize: 6 }, { text: tax, alignment: 'right', fontSize: 6 }],
                                [{ text: 'Total Tagihan', bold: true, fontSize: 6 }, { text: total, alignment: 'right', fontSize: 6, bold: true }]
                            ]
                        },
                        layout: 'noBorders',
                        margin: [0, 5] // Margin for spacing
                    },

                    { text: '_______________________________________', style: 'separator', alignment: 'center' },
                    { text: 'Follow Instagram: @kedaikopikita.tpi', style: 'subHeader', alignment: 'center' },
                    { text: 'Terima Kasih!', style: 'totals', alignment: 'center' },


                ],
                styles: {
                    header: { fontSize: 16, bold: true, margin: [0, 2] },
                    subHeader: { fontSize: 5 },
                    details: { fontSize: 5, margin: [0, 1] },
                    separator: { fontSize: 8, margin: [0, 2] },
                    totals: { fontSize: 6, bold: true, margin: [0, 2] },
                }
            };

            // Generate PDF
            pdfMake.createPdf(docDefinition).open();
        }

        function generateReport() {

            const TAX_PERCENTAGE = <?php echo $taxPercentage; ?>;

            const startDateInput = document.getElementById('startDate').value;
            const endDateInput = document.getElementById('endDate').value;
            const kategoriFilter = document.getElementById('kategoriFilter').value;

            const fmtDate = d => d
                ? new Date(d).toLocaleDateString('id-ID', { day: 'numeric', month: 'long', year: 'numeric' })
                : '-';

            const dateInfo1 = `Dari: ${fmtDate(startDateInput)}`;
            const dateInfo2 = `Sampai: ${fmtDate(endDateInput)}`;
            const categoryInfo = kategoriFilter
                ? `Kategori: ${kategoriFilter.charAt(0).toUpperCase() + kategoriFilter.slice(1)}`
                : 'Kategori: Semua Produk';

            // 1) Filter & group by product_name
            const grouped = orderItems
                .filter(({ product_name }) => {
                    if (!kategoriFilter) return true;
                    return productToCategory[product_name].toLowerCase() === kategoriFilter;
                })
                .reduce((acc, { product_name, quantity, price }) => {
                    if (!acc[product_name]) acc[product_name] = { quantity: 0, unitPrice: price };
                    acc[product_name].quantity += parseInt(quantity, 10);
                    return acc;
                }, {});

            // 2) Sort by stand ascending
            const sortedEntries = Object.entries(grouped).sort((a, b) => {
                const numA = parseInt((productToStand[a[0]].match(/\d+/) || [0])[0], 10);
                const numB = parseInt((productToStand[b[0]].match(/\d+/) || [0])[0], 10);
                return numA - numB;
            });

            // 3) Build first table body
            const body1 = [

                [
                    { text: 'Produk', bold: true },
                    { text: 'Kategori', bold: true },
                    { text: 'Stand', bold: true },
                    { text: 'Qty', bold: true, alignment: 'right' },
                    { text: 'Harga Satuan', bold: true, alignment: 'right' },
                    { text: 'Pendapatan (Rp)', bold: true, alignment: 'right' }
                ],
                ...sortedEntries.map(([name, { quantity, unitPrice }]) => {
                    const lineTotal = quantity * unitPrice;
                    return [
                        name,
                        productToCategory[name],
                        productToStand[name],
                        { text: quantity.toString(), alignment: 'right' },
                        { text: `Rp ${unitPrice.toLocaleString('id-ID')}`, alignment: 'right' },
                        { text: `Rp ${lineTotal.toLocaleString('id-ID')}`, alignment: 'right' }
                    ];
                })
            ];

            // 4) Compute earnings per stand
            const earnings = {};
            sortedEntries.forEach(([name, { quantity, unitPrice }]) => {
                const stand = productToStand[name] || 'Stand 0';
                earnings[stand] = (earnings[stand] || 0) + (quantity * unitPrice);
            });

            const body2 = [
                [
                    { text: 'Stand', bold: true },
                    { text: 'Pendapatan (Rp)', bold: true, alignment: 'right' }
                ],
                ...Object.entries(earnings)
                    .sort((a, b) => {
                        const na = parseInt((a[0].match(/\d+/) || [0])[0], 10);
                        const nb = parseInt((b[0].match(/\d+/) || [0])[0], 10);
                        return na - nb;
                    })
                    .map(([stand, total]) => [
                        stand,
                        { text: total.toLocaleString('id-ID'), alignment: 'right' }
                    ])
            ];

            const grandTotal = sortedEntries.reduce((sum, [, { quantity, unitPrice }]) => {
                return sum + (quantity * unitPrice);
            }, 0);
            const totalEarnings = Object.values(earnings).reduce((sum, val) => sum + val, 0);

            body2.push(
                [{ text: 'Pajak ', bold: true }, { text: `Rp ${((TAX_PERCENTAGE / 100) * grandTotal).toLocaleString('id-ID')}`, alignment: 'right', bold: true }],
                [{ text: 'Total Pendapatan Bersih   ', bold: true }, { text: `Rp ${totalEarnings.toLocaleString('id-ID')}`, alignment: 'right', bold: true }]
            );

            // 5) PDF definition with both tables
            const dd = {
                pageSize: 'A4',
                content: [
                    { text: 'Laporan Penjualan Kedai Kopi Kita', style: 'header', alignment: 'center', margin: [0, 0, 0, 10] },
                    { text: dateInfo1, margin: [0, 0, 0, 2] },
                    { text: dateInfo2, margin: [0, 0, 0, 10] },
                    { text: categoryInfo, margin: [0, 0, 0, 15] },

                    { text: 'Pendapatan Bersih Produk', style: 'subheader', margin: [0, 0, 0, 5] },
                    // First table
                    {
                        table: { headerRows: 1, widths: ['*', '*', '*', 'auto', 'auto', 'auto'], body: body1 },
                        layout: 'lightHorizontalLines'
                    },

                    // Spacer
                    { text: '\n' },

                    // Second table: earnings
                    { text: 'Pendapatan Bersih Stand', style: 'subheader', margin: [0, 0, 0, 5] },
                    {
                        table: { headerRows: 1, widths: ['*', 'auto'], body: body2 },
                        layout: 'lightHorizontalLines'
                    }
                ],
                styles: {
                    header: { fontSize: 16, bold: true },
                    subheader: { fontSize: 14, bold: true }
                }
            };

            pdfMake.createPdf(dd).open();
        }









    </script>

